import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Fridge Friend</h1>
      </header>
    </div>
  );
}

function ShoppingTitle(props){
  return (
      <div>
          <h1>Test Title</h1>
          <h2>Test Description</h2>
      </div>

  ) 
}

export default App;
